        const poiFitToBounds = function (coords) {
            const bbox = geolib.getBounds(coords);
            const bounds = [[bbox.minLng, bbox.minLat], [bbox.maxLng, bbox.maxLat]];
            mapViewPoi.fitBounds(bounds, {
                padding: 60
            });
