		<script>
			function initialize() {
				var markers = new Array();

				var mapOptions = {
					zoom: 12,
					streetViewControl: false,
					disableDefaultUI: true,
					mapTypeControl: false,
					styles: CustomMapStylesHotspots,
					mapTypeId: google.maps.MapTypeId.ROADMAP,
					center: new google.maps.LatLng(<?=$center?>)
				};

				var locations = [
					<?=$location?>
				];

				var map = new google.maps.Map(document.getElementById('map-canvas'), mapOptions);

				var infowindow = new google.maps.InfoWindow();
				
				for (var i = 0; i < locations.length; i++) {

					// Append a link to the markers DIV for each marker
					//$('#markers').append('<a class="marker-link" data-markerid="' + i + '" href="#">' + locations[i][1] + '</a> ');

					var marker = new google.maps.Marker({
						//icon: 'https://drama.smartiscity.gr/dashboard/assets/plugins/Mapplic/mapplic/images/pin-red.png',
						//icon: 'https://drama.smartiscity.gr/dashboard/assets/plugins/Mapplic/mapplic/images/pin-green.png',
						icon: 'https://drama.smartiscity.gr/dashboard/assets/plugins/Mapplic/mapplic/images/pin-orange.png',
						//icon: 'https://drama.smartiscity.gr/dashboard/assets/plugins/Mapplic/mapplic/images/pin-purple.png',
						//icon: 'https://drama.smartiscity.gr/gallery/mapicons/wifi_pin.svg',
						
						position: locations[i][0],
						map: map,
						title: locations[i][1],
					});
					  google.maps.event.addListener(marker, 'click', (function(marker, i) {
						return function() {
						  //infowindow.setContent(locations[i][0]);
						  //infowindow.open(map, marker);
							map.panTo(this.getPosition());
							map.setZoom(15);
							infowindow.setContent(locations[i][2]);
							infowindow.open(map, marker);
						}
					  })(marker, i));
					  
					// Register a click event listener on the marker to display the corresponding infowindow content
					//google.maps.event.addListener(marker, 'click', (function (marker, i) {
					//	return function () {
					//		infowindow.setContent(locations[i][2]);
					//		infowindow.open(map, marker);
					//	}

					//})(marker, i));

					// Add marker to markers array
					markers.push(marker);
					//alert(markers);
				}

				// Trigger a click event on each marker when the corresponding marker link is clicked
				$('.marker-link').on('click', function () {
					//alert($(this).data('markerid'));
					google.maps.event.trigger(markers[$(this).data('markerid')], 'click');
				});
			}

			initialize();
		</script>

			
